import styled from "styled-components"

const Container = styled.div`
<height:30px;
background-color: #  ${mobile({ height: "20vh" })}
;
color:white;
display:flex;
align-items:center;
justify-content:center;
font-size:14px;
font-weight:bold;
`
const Announcement = () => {
  return (
    <Container>
        FREE FREE FREE!!!! 
        </Container>
  )
}

export default Announcement;
